	(4, 'content:3.content', 'wysiwyg', '<p><u>Datenschutzbestimmungen f체r die Teilnahme an einer eSport Online Veranstaltung:</u></p>\n\n<p><strong>Allgemeines</strong></p>\n\n<p>Die nachfolgenden Darstellungen geben Dir einen berblick dar체ber, wie das eSportStudio (eSport Studio GmbH &amp; Co.KG, Ganghoferstr. 68, 80339 M체nchen) als Veranstalter oder/und Kooperationspartner/durchf체hrendes Unternehmen eines anderen Veranstalters (nachfolgend Kooperationspartner oder Partnerunternehmen) den Schutz Deiner Daten gew채hrleisten und welche Art von Daten (also personen-, inhalts- oder/und auftragsbezogene Daten) zu welchem Zweck von uns erhoben werden. berdies gibst Du mit dem Akzeptieren der Datenschutzbestimmungen zugleich die unter Ziffer 4 aufgef체hrten Einwilligungserkl채rungen ab, die Du jederzeit widerrufen kannst. Bei Widerruf treten die unter Ziffer 5 genannten Rechtsfolgen ein. Bevor wir Informationen zu anderen als den in diesen Datenschutzbestimmungen aufgef체hrten Zwecken nutzen, werden wir Dich um Einwilligung bitten. Bei der Erhebung und Nutzung Deiner Daten achten wir auf die Einhaltung des deutschen Bundesdatenschutzgesetzes, der Telemediengesetze und der sonstigen anwendbaren datenschutzrechtlichen Bestimmungen. eSport Studio ist ein praktikabler Datenschutz ihrer Nutzer in Bezug auf nutzungsbasierte Online-Werbung wichtig. ber die gesetzlichen Vorgaben und die strikte Pseudonymisierung der erhobenen Daten hinaus befolgen wir deshalb die selbstregulativen Vorgaben des IAB Europe Framework for Online Behavioral Advertising und des Deutschen Datenschutzrates Online-Werbung in Bezug auf nutzungsbasierte Online-Werbung. Den g체ltigen Selbstregulierungskodex kannst Du unter folgendem Link einsehen:<a href="http://www.meine-cookies.org/ddow.html" target="_blank">www.meine-cookies.org/ddow.html</a></p>\n\n<p>Wir halten wirtschaftlich angemessene organisatorische, personelle und technische Manahmen vor, um Deine pers철nlichen Daten nach besten Kr채ften und nach Magabe verkehrs체blicher Standards vor Verlust, unbefugtem Zugriff und Manipulation zu sch체tzen.</p>\n\n<p>Die Verantwortung f체r den Datenschutz tr채gt grunds채tzlich eSport Studio und der im Impressum auf der Startseite genannte Kooperationspartner bzw. Betreiber der Internetseite, es sei denn, die Datenerhebung und -auswertung werden allein durch die Partnerunternehmen von eSport Studio vorgenommen und so veranlasst. Insofern gelten die vorliegenden Bestimmungen auch im Namen des jeweiligen Partnerunternehmens.</p>\n\n<p>Die Webseiten des Partnerunternehmens nat체rlich besucht werden, ohne dass irgendwelche Angaben zur Person gemacht werden m체ssen. Wir speichern zun채chst lediglich Zugriffsdaten ohne Personenbezug, die keinen R체ckschluss auf die Person zulassen. Die Datenspeicherung erfolgt zur Verbesserung unseres Angebotes. Zur Erhebung personenbezogener Daten kommt es nur, wenn eine Registrierung gewollt ist und Du Teil des eSport Studio-Netzwerkes sein m철chten. Dabei hat die Anmeldung mit dem echten Namen zu erfolgen. Der Grund ist einfach: mehr Transparenz und Lebenswirklichkeit sowie ein verbesserter Schutz gegen Fakeprofile und anonyme Verletzungen Ihrer Pers철nlichkeitsrechte. Die Angaben des Alters und des Wohnsitzes dienen insbesondere auch dem Jugendschutz.</p>\n\n<p>Wenn Du die auf der Webseite zus채tzlichen Angebote und Informationen (z.B. Newsletter, zus채tzliche Angebote unserer exklusiven Kooperationspartner) empfangen m철chtest (ausdr체ckliche Zustimmung erforderlich), erfolgt die Aussendung dieser Angebote und Informationen an Deine angegebene E-Mail-Adresse. Deine Einwilligung zum Empfang kannst Du jederzeit widerrufen.</p>\n\n<p>Die Teilnahme an den von Webseiten des Partnerunternehmens (nachfolgend auch Seiten) veranstalteten Turniercups/Ligenveranstaltungen/Duellen etc. setzt aber zwingend eine Registrierung des Users mit den nachfolgend genannten Daten voraus. Dies betrifft auch solche Cups, Wettbewerbe, die von eSport Studio selbst veranstaltet oder ver철ffentlicht werden (auf eigenen Webseiten, u.U. auch unter anderen Marken auf diesen eigenen Seiten)</p>\n\n<h5><strong>Informationen zur Datenerhebung und Datennutzung</strong></h5>\n\n<p>a) Bei der User-Registrierung f체r die Teilnahme an den Turnieren oder von weiteren Leistungen von eSport Studio oder/und vom Partnerunternehmen werden personenbezogene Daten erhoben. Nach dem Bundesdatenschutzgesetz sind personenbezogene Daten Einzelangaben 체ber pers철nliche oder sachliche Verh채ltnisse einer bestimmten oder bestimmbaren nat체rlichen Person. Einzelangaben 체ber pers철nliche oder sachliche Verh채ltnisse sind beispielsweise:</p>\n\n<ul>\n	<li>IP Adresse</li>\n	<li>User Agent (Betriebssystem, Browser etc.)</li>\n	<li>Bildschirmaufl철sung</li>\n	<li>Session</li>\n	<li>Interaktionen</li>\n	<li>Benutzername</li>\n	<li>E-Mail-Adresse</li>\n	<li>Passwort</li>\n	<li>Anmeldestatus zum Newsletter</li>\n	<li>AGB akzeptiert</li>\n	<li>Vorname</li>\n	<li>Nachname</li>\n	<li>Profilbild</li>\n	<li>Geschlecht</li>\n	<li>Team-Name</li>\n	<li>Geburtsdatum</li>\n	<li>LieblingsGames</li>\n	<li>PlayStation Network ID</li>\n	<li>Skype ID</li>\n	<li>Steam ID</li>\n	<li>Origin ID</li>\n	<li>Battlenet ID</li>\n	<li>Uplay ID</li>\n	<li>Xbox Live Gamertag</li>\n	<li>Twitch Name</li>\n	<li>YouTube Name</li>\n	<li>Hitbox Name</li>\n	<li>Verf체gbare Systeme</li>\n	<li>Strae</li>\n	<li>Hausnummer</li>\n	<li>PLZ</li>\n	<li>Stadt</li>\n	<li>Land</li>\n	<li>Sprache</li>\n</ul>\n\n<p>Die daraus resultierenden Daten werden in unseren Datenbanken und in unserem Filesystem (Tracking) gespeichert.</p>\n\n<p>Bestimmte Angaben sind f체r eine Registrierung bei dem Turniersystem von eSport Studio und damit f체r eine Nutzung des Turniersystems zum Teil verpflichtend. Wenn eine Verpflichtung besteht, wird dies entsprechend gekennzeichnet. Diese personenbezogenen Daten sind umfassend gesch체tzt. F체r andere Nutzer einsehbar sind in jedem Falle nur Vorname, Name (zusammen der Benutzername, der nur mit Zustimmung von eSport Studi