p;f체r einen Inhalt +1 gegeben hast, als auch Informationen 체ber die Seite, die Du&nbsp;beim Klicken auf +1 angesehen hast. Deine&nbsp;+1 k철nnen als Hinweise zusammen mit Deinem&nbsp;Profilnamen und Deinem&nbsp;Foto in Google-Diensten, wie etwa in Suchergebnissen oder in Deinem&nbsp;Google-Profil, oder an anderen Stellen auf Websites und Anzeigen im Internet eingeblendet werden.</p>\n\n<p>Google zeichnet Informationen 체ber Deine +1-Aktivit채ten auf, um die Google-Dienste f체r Dich und andere zu verbessern. Um die Google +1-Schaltfl채che verwenden zu k철nnen, ben철tigst Du ein weltweit sichtbares, 철ffentliches Google-Profil, das zumindest den f체r das Profil gew채hlten Namen enthalten muss. Dieser Name wird in allen Google-Diensten verwendet. In manchen F채llen kann dieser Name auch einen anderen Namen ersetzen, den Du beim Teilen von Inhalten 체ber Ihr Google-Konto verwendet hast. Die Identit채t Deines Google-Profils kann Nutzern angezeigt werden, die Deine E-Mail-Adresse kennen oder 체ber andere identifizierende Informationen von Dir verf체gen.</p>\n\n<p>Neben den oben erl채uterten Verwendungszwecken werden die von Dir bereitgestellten Informationen gem채 den geltenden Google-Datenschutzbestimmungen genutzt. Google ver철ffentlicht m철glicherweise zusammengefasste Statistiken 체ber die +1-Aktivit채ten der Nutzer bzw. gibt diese an Nutzer und Partner weiter, wie etwa Publisher, Inserenten oder verbundene Websites.</p>\n\n<p>c) eSport Studio verwendet Social Plugins (Plugins- hierbei insbesondere den Button Gef채llt mir) des sozialen Netzwerkes facebook.com, welches von der Facebook Inc., 1601 S. California Ave, Palo Alto, CA 94304, USA betrieben wird (Facebook). Die Plugins sind mit einem Facebook Logo oder dem Zusatz Facebook Social Plugin gekennzeichnet. Plugins sind Computerprogramme, die zur Erweiterung der Funktionalit채t in ein anderes Softwareprodukt eingebettet sind. Solltest Du eine Webseite unseres Internetauftritts aufrufen, die ein solches Plugin enth채lt, wird eine direkte Verbindung mit den Servern von Facebook hergestellt, der Inhalt des Plugins von Facebook direkt an Deinen Browser 체bermittelt und von diesem in die Webseite eingebunden. Durch die Einbindung der Plugins erh채lt Facebook die Information, dass Du die entsprechende Seite unseres Internetauftritts aufgerufen hast. Bist Du bei Facebook eingeloggt kann Facebook den Besuch Deinem Facebook-Konto zuordnen. Wenn Du mit den Plugins interagierst, zum Beispiel den Gef채llt mir Button bet채tigst oder einen Kommentar abgibst, wird die entsprechende Information direkt an Dein Facebook-Konto 체bermittelt, gespeichert und ggf. dort angezeigt. Umfassende Informationen zur Erhebung, Speicherung und Nutzung Deiner Daten durch Facebook, zur diesbez체glichen Aus체bung Deiner Rechte und zum Schutz Ihrer Privatsph채re findest Du in den Facebook Datenschutzrichtlinien und dem Leitfaden zur Privatsph채re. Wenn Du nicht m철chtest, dass Facebook 체ber den Internetauftritt von eSport Studio personenbezogen Daten 체ber Dich sammelt, musst Du dich vor Deinem Besuch unseres Internetauftritts lediglich bei Facebook ausloggen.</p>\n\n<p>d) Auf den Seiten von eSport Studio sind auch Funktionen des Dienstes Twitter eingebunden. Diese Funktionen werden angeboten durch die Twitter Inc., 795 Folsom St., Suite 600, San Francisco, CA 94107, USA. Durch das Benutzen von Twitter und der Funktion Re-Tweet werden die von Dir besuchten Webseiten mit Deinem Twitter-Account verkn체pft und anderen Nutzern bekannt gegeben. Dabei werden auch Daten an Twitter 체bertragen.</p>\n\n<p>Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der 체bermittelten Daten sowie deren Nutzung durch Twitter erhalten. Weitere Informationen hierzu findest Du in der Datenschutzerkl채rung von Twitter unter&nbsp;<a href="http://twitter.com/privacy" target="_blank">http://twitter.com/privacy</a>.</p>\n\n<p>Deine&nbsp;Datenschutzeinstellungen bei Twitter kannst Du&nbsp;in den Konto-Einstellungen unter&nbsp;<a href="http://twitter.com/account/settings" target="_blank">http://twitter.com/account/settings&nbsp;</a>채ndern.</p>\n\n<h5><strong>Einwilligungserkl채rungen</strong></h5>\n\n<p>Durch Deine Zustimmung zu den Datenschutzbestimmungen gibst Du zugleich folgende Einwilligungen ab:</p>\n\n<ul>\n	<li>die Einwilligung, dass die bei meiner Registrierung mitgeteilten Stammdaten allen Nutzern der Websites des Partnerunternehmens oder von Webseiten von eSportStudio zug채nglich sind und von diesen eingesehen werden k철nnen.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass eine von mir auf Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio hochgeladene und meinem eigenen Profil hinzugef체gte Bilddatei allen Nutzern der Websites des Partnerunternehmens oder von Webseiten von eSportStudio zug채nglich ist und von diesen eingesehen werden kann.</li>\n</ul>\n\n<p><em>(Hinweis: Du hast jederzeit die M철glichkeit, den Zugriff der User auf Deine weiteren personenbezogenen Daten einzuschr채nken oder auszuschlieen)</em></p>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio Cookies verwendet und damit Nutzungsdaten von mir erhebt, verarbeitet und nutzt, wie unter den Ziffern 2 und 3 beschrieben. So k철nnen etwa die beim Einloggen f체r meine Authentifizierung abgefragten Daten gespeichert werden, um mir ein vereinfachtes Einloggen zu erm철glichen. Dar체ber hinaus dienen Cookies unter anderem auch der pers철nlichen Begr체ung und der Bereitstellung von Anwendungen, die auf mich als Nutzer zugeschnitten sind.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass bei einem von mir veranlassten Zugriff auf Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio automatisch Informationen durch den von mir verwendeten Internet-Browser 체bermittelt werden und dass eSport Studio diese in den so genannten Protokolldateien gespeicherten Daten auswertet und analysiert, wie unter Ziffer 2. (s.o.) aufgef체hrt, also dass auch dass die beispielsweise genannten Daten in Ziffer 2 in den Datenbanken und in den File-Systemen von eSport Studio und vom Olympia Verlag gespeichert werden k철nnen.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass bei einem von mir veranlassten Zugriff auf Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio automatisch Informationen durch den von mir verwendeten Internet-Browser 체bermittelt werden und dass eSport Studio diese in den so genannten Protokolldateien gespeicherten Daten auswertet und analysiert, wie unter Ziffer 2. (s.o.) aufgef체hrt, also dass auch dass die beispielsweise genannten Daten in Ziffer 2 in den Datenbanken und in den File-Systemen von eSport Studio und vom Olympia Verlag gespeichert werden k철nnen.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass von mir hochgeladene Multimediadateien sowie mein Status der Teilnahme an Aktionen, Veranstaltungen, Rankings, Tippspiele innerhalb von Widgets und anderen technischen Einrichtungen auf externen Seiten unter Verwendung meines Namens ausgespielt werden k철nnen. Dies umfasst auch den Einsatz in einer Facebook App, bei Whatsapp oder 채hnlichen Apps. Zudem sind Kommentierungen zu News, Posts, Spielerseiten u.채. auch auerhalb von eSport Studio, also f체r nicht registrierte Nutzer einzusehen.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio bei Mitwirkung an einem Turnier die erreichten Siege, Unentschieden, Niederlagen, Anzahl der Spiele, die Spielergebnisse unter Verwendung meines Namens in beliebigen Rankings abbilden bzw. benennen darf.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass die Daten, die ich als registrierter User auf den Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio hochlade, f체r alle einsehbar sind. Eine Einschr채nkung kann nicht verlangt werden.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio die von mir bei der Registrierung mitgeteilten Daten dazu nutzt, um mir gezielt personalisierte Werbung und/oder besondere Angebote und Services 체ber eSport Studio und deren Kooperationspartner zu pr채sentieren bzw. pr채sentieren zu lassen.</li>\n</ul>\n\n<p><em>(Hinweis: Einer personalisierten Werbung kann im Falle der Schaltung widersprochen werden)</em></p>\n\n<ul>\n	<li>die Einwilligung, dass mir eSport Studio und/oder der Olympia Verlag Mitteilungen an meine Email-Adresse zusenden kann und dass eSport Studio oder/und der Olympia Verlag meine personenbezogenen Daten nutzt, um mir Marketing-Mitteilungen unter Verwendung elektronischer Post zuzusenden, wobei wir auf einen ausreichenden Jugendschutz achten.</li>\n</ul>\n\n<p><em>(Diesen Marketingmitteilungen kann jederzeit widersprochen werden, sofern solche erfolgen. Hierzu werden entsprechende nderungen bei Einstellungen zur Nutzung meiner Daten erm철glicht.)</em></p>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio und/oder der Olympia Verlag die beschriebenen Dienste der in den Ziffern 3 a bis d beispielhaft aufgef체hrten Anbieter in Bezug auf meine Daten nutzen darf.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio und/oder der Olympia Verlag Bestandsdaten und/oder Nutzungsdaten von mir an Ermittlungs-, Strafverfolgungs- und Aufsichtsbeh철rden weitergibt, wenn und soweit dies zur Abwehr von Gefahren f체r die staatliche und 철ffentliche Sicherheit sowie zur Verfolgung von Straftaten erforderlich ist.</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h5><strong>Sonstige Bestimmungen</strong></h5>\n\n<p>Sofern Du den schriftlichen Wunsch unter Nachweis Deiner Identit채t 채uerst, geben wir Dir gerne dar체ber Auskunft, welche personenbezogenen Daten 체ber Dich zu welchem Zweck gespeichert sind, sowie Auskunft dar체ber, an welche Empf채nger oder welche Kategorien von Empf채ngern diese Daten weitergegeben werden. Auerdem hast Du die M철glichkeit, die zu Deiner Person gespeicherten personenbezogenen Daten (siehe hierzu Ziffer 2) jederzeit in den Einstellungen Ihres Nutzeraccounts einzusehen und zu 채ndern (ausgenommen der Benutzername). Ferner kannst Du die Einstellungen Deines Internet-Browser so anpassen, dass Cookies automatisch abgelehnt werden. In diesem Fall kann es allerdings sein, dass Dir 체ber Deinen Nutzeraccount bestimmte Anwendungen nicht mehr zur Verf체gung stehen.</p>\n\n<p>Du kannst weiterhin die vorstehenden Einwilligungen jederzeit mit Wirkung f체r die Zukunft einzeln oder insgesamt etwa per E-Mail an <a href="mailto:info@eSportStudio.de" target="_top">info@eSportStudio.de</a> gegen체ber widerrufen und 체berdies Deine personenbezogenen Daten durch uns l철schen oder vor체bergehend sperren lassen. Hiervon ausgenommen sind ausschlielich die Daten, zu deren Aufbewahrung wir gesetzlich verpflichtet sind. Nach L철schung oder Sperrung Deines Accounts sind solche Nutzungen und Anwendungen ausgeschlossen, die mit einer Registrierung verbunden sind.</p>\n\n<p>eSport Studio beh채lt sich das Recht vor, diese Datenschutzbestimmungen jederzeit nach Magabe der gesetzlichen und rechtlichen Vorschriften zu 채ndern. Wir werden Dich von einer nderung der Bestimmungen per E-Mail in Kenntnis setzen. Du kannst der nderung innerhalb von zwei Wochen per E-Mail an&nbsp;<a href="mailto:info@eSportStudio.de" target="_top">info@eSportStudio.de</a>&nbsp;widersprechen. Nach Ablauf dieser Frist gilt die nderung von Dir als angenommen. Sofern Du widersprichst, ist eSport Studio berechtigt, Deine Registrierung zu l철schen.</p>\n\n<p>&nbsp;</p>\n'),
