	(29, 'content:1.content', 'wysiwyg', '<p>This page demonstrates how to use the "Tag &amp; Snippet Management" to inject codes into the HTML source code. This functionality can be used to easily integrate tracking codes, conversion codes, social plugins and whatever that needs to go into the HTML.</p>\n\n<p>&nbsp;</p>\n\n<p>The functionality is similar to this products:&nbsp;</p>\n\n<p><a href="http://www.google.com/tagmanager/">http://www.google.com/tagmanager/</a>&nbsp;</p>\n\n<p><a href="http://www.searchdiscovery.com/satellite/">http://www.searchdiscovery.com/satellite/&nbsp;</a></p>\n\n<p><a href="http://www.tagcommander.com/en/">http://www.tagcommander.com/en/</a></p>\n\n<p>&nbsp;</p>\n\n<p>In our example we use it to integrate a facebook social plugin.</p>\n'),
