	(77, 'content:3.content', 'wysiwyg', '<p><u>Datenschutzbestimmungen f체r die Teilnahme an einer eSport Online Veranstaltung:</u></p>\n\n<p><strong>Allgemeines</strong></p>\n\n<p>Die nachfolgenden Darstellungen geben Dir einen berblick dar체ber, wie das eSportStudio (eSport Studio GmbH &amp; Co.KG, Ganghoferstr. 68, 80339 M체nchen) als Veranstalter oder/und Kooperationspartner/durchf체hrendes Unternehmen eines anderen Veranstalters (nachfolgend Kooperationspartner oder Partnerunternehmen) den Schutz Deiner Daten gew채hrleisten und welche Art von Daten (also personen-, inhalts- oder/und auftragsbezogene Daten) zu welchem Zweck von uns erhoben werden. berdies gibst Du mit dem Akzeptieren der Datenschutzbestimmungen zugleich die unter Ziffer 4 aufgef체hrten Einwilligungserkl채rungen ab, die Du jederzeit widerrufen kannst. Bei Widerruf treten die unter Ziffer 5 genannten Rechtsfolgen ein. Bevor wir Informationen zu anderen als den in diesen Datenschutzbestimmungen aufgef체hrten Zwecken nutzen, werden wir Dich um Einwilligung bitten. Bei der Erhebung und Nutzung Deiner Daten achten wir auf die Einhaltung des deutschen Bundesdatenschutzgesetzes, der Telemediengesetze und der sonstigen anwendbaren datenschutzrechtlichen Bestimmungen. eSport Studio ist ein praktikabler Datenschutz ihrer Nutzer in Bezug auf nutzungsbasierte Online-Werbung wichtig. ber die gesetzlichen Vorgaben und die strikte Pseudonymisierung der erhobenen Daten hinaus befolgen wir deshalb die selbstregulativen Vorgaben des IAB Europe Framework for Online Behavioral Advertising und des Deutschen Datenschutzrates Online-Werbung in Bezug auf nutzungsbasierte Online-Werbung. Den g체ltigen Selbstregulierungskodex kannst Du unter folgendem Link einsehen:<a href="http://www.meine-cookies.org/ddow.html" target="_blank">www.meine-cookies.org/ddow.html</a></p>\n\n<p>Wir halten wirtschaftlich angemessene organisatorische, personelle und technische Manahmen vor, um Deine pers철nlichen Daten nach besten Kr채ften und nach Magabe verkehrs체blicher Standards vor Verlust, unbefugtem Zugriff und Manipulation zu sch체tzen.</p>\n\n<p>Die Verantwortung f체r den Datenschutz tr채gt grunds채tzlich eSport Studio und der im Impressum auf der Startseite genannte Kooperationspartner bzw. Betreiber der Internetseite, es sei denn, die Datenerhebung und -auswertung werden allein durch die Partnerunternehmen von eSport Studio vorgenommen und so veranlasst. Insofern gelten die vorliegenden Bestimmungen auch im Namen des jeweiligen Partnerunternehmens.</p>\n\n<p>Die Webseiten des Partnerunternehmens nat체rlich besucht werden, ohne dass irgendwelche Angaben zur Person gemacht werden m체ssen. Wir speichern zun채chst lediglich Zugriffsdaten ohne Personenbezug, die keinen R체ckschluss auf die Person zulassen. Die Datenspeicherung erfolgt zur Verbesserung unseres Angebotes. Zur Erhebung personenbezogener Daten kommt es nur, wenn eine Registrierung gewollt ist und Du Teil des eSport Studio-Netzwerkes sein m철chten. Dabei hat die Anmeldung mit dem echten Namen zu erfolgen. Der Grund ist einfach: mehr Transparenz und Lebenswirklichkeit sowie ein verbesserter Schutz gegen Fakeprofile und anonyme Verletzungen Ihrer Pers철nlichkeitsrechte. Die Angaben des Alters und des Wohnsitzes dienen insbesondere auch dem Jugendschutz.</p>\n\n<p>Wenn Du die auf der Webseite zus채tzlichen Angebote und Informationen (z.B. Newsletter, zus채tzliche Angebote unserer exklusiven Kooperationspartner) empfangen m철chtest (ausdr체ckliche Zustimmung erforderlich), erfolgt die Aussendung dieser Angebote und Informationen an Deine angegebene E-Mail-Adresse. Deine Einwilligung zum Empfang kannst Du jederzeit widerrufen.</p>\n\n<p>Die Teilnahme an den von Webseiten des Partnerunternehmens (nachfolgend auch Seiten) veranstalteten Turniercups/Ligenveranstaltungen/Duellen etc. setzt aber zwingend eine Registrierung des Users mit den nachfolgend genannten Daten voraus. Dies betrifft auch solche Cups, Wettbewerbe, die von eSport Studio selbst veranstaltet oder ver철ffentlicht werden (auf eigenen Webseiten, u.U. auch unter anderen Marken auf diesen eigenen Seiten)</p>\n\n<h5><strong>Informationen zur Datenerhebung und Datennutzung</strong></h5>\n\n<p>a) Bei der User-Registrierung f체r die Teilnahme an den Turnieren oder von weiteren Leistungen von eSport Studio oder/und vom Partnerunternehmen werden personenbezogene Daten erhoben. Nach dem Bundesdatenschutzgesetz sind personenbezogene Daten Einzelangaben 체ber pers철nliche oder sachliche Verh채ltnisse einer bestimmten oder bestimmbaren nat체rlichen Person. Einzelangaben 체ber pers철nliche oder sachliche Verh채ltnisse sind beispielsweise:</p>\n\n<ul>\n	<li>IP Adresse</li>\n	<li>User Agent (Betriebssystem, Browser etc.)</li>\n	<li>Bildschirmaufl철sung</li>\n	<li>Session</li>\n	<li>Interaktionen</li>\n	<li>Benutzername</li>\n	<li>E-Mail-Adresse</li>\n	<li>Passwort</li>\n	<li>Anmeldestatus zum Newsletter</li>\n	<li>AGB akzeptiert</li>\n	<li>Vorname</li>\n	<li>Nachname</li>\n	<li>Profilbild</li>\n	<li>Geschlecht</li>\n	<li>Team-Name</li>\n	<li>Geburtsdatum</li>\n	<li>LieblingsGames</li>\n	<li>PlayStation Network ID</li>\n	<li>Skype ID</li>\n	<li>Steam ID</li>\n	<li>Origin ID</li>\n	<li>Battlenet ID</li>\n	<li>Uplay ID</li>\n	<li>Xbox Live Gamertag</li>\n	<li>Twitch Name</li>\n	<li>YouTube Name</li>\n	<li>Hitbox Name</li>\n	<li>Verf체gbare Systeme</li>\n	<li>Strae</li>\n	<li>Hausnummer</li>\n	<li>PLZ</li>\n	<li>Stadt</li>\n	<li>Land</li>\n	<li>Sprache</li>\n</ul>\n\n<p>Die daraus resultierenden Daten werden in unseren Datenbanken und in unserem Filesystem (Tracking) gespeichert.</p>\n\n<p>Bestimmte Angaben sind f체r eine Registrierung bei dem Turniersystem von eSport Studio und damit f체r eine Nutzung des Turniersystems zum Teil verpflichtend. Wenn eine Verpflichtung besteht, wird dies entsprechend gekennzeichnet. Diese personenbezogenen Daten sind umfassend gesch체tzt. F체r andere Nutzer einsehbar sind in jedem Falle nur Vorname, Name (zusammen der Benutzername, der nur mit Zustimmung von eSport Studio ge채ndert werden darf), Pseudonym, Zeitpunkt der Registrierung, Zahl der Aufrufe, Gebietszugeh철rigkeit (nachfolgend Stammdaten genannt). Diese Daten sind damit auch durch Suchmaschinen wie beispielsweise Google m철glicherweise indizierbar, wobei wir dies auszuschlieen versuchen.</p>\n\n<p>Nachrichten von anderen Nutzern erh채ltst Du 체ber unser internes Nachrichtensystem. Du kannst die Anzahl der auf Deiner personalisierten Webseite 철ffentlich angezeigten Daten und Informationen in Deinen pers철nlichen Einstellungen anpassen und einschr채nken.</p>\n\n<p>Deine E-Mail-Adresse geben wir zu keinem Zeitpunkt an Dritte (Dritte sind nicht Gesellschaften, die zu eSport Studio geh철ren, oder das Partnerunternehmen mit seinen verbundenen Unternehmen, welches selbst Veranstalter der eSport Online Veranstaltung ist, f체r das das eSport Studio t채tig ist  nachfolgend Partnerunternehmen) weiter. Im Falle von Aktionen, Veranstaltungen, Gewinnspielen, bei Werbekampagnen f체r eSport Studio mit seinen Marken, Labels oder dem Partnerunternehmen mit seinen Marken, Labels kann Dein Eintrag bei dem Partnerunternehmen oder auf den Seiten oder in den Medien von eSport Studio ver철ffentlicht werden. Dabei wird lediglich Dein Name, Vorname ver철ffentlicht. Der Ver철ffentlichung Deiner Daten auf Partnerseiten, die nicht zum eSport Studio-Online-Netzwerk (eigene Webseiten des eSport Studio bzw. Webseiten in der Inhaberschaft oder Verantwortung des eSport Studio) bzw. dem Partnerunternehmen geh철ren, kannst Du jederzeit widersprechen. Dein Eintrag auf den Seiten des Partnerunternehmens bleibt davon unber체hrt.</p>\n\n<p>Auch Deine weiteren personenbezogenen Daten, die uns 체bermittelt werden, geben oder ver채uern wir ansonsten nicht an Dritte auerhalb von eSport Studio oder/und vom Partnerunternehmen weiter, es sei denn, Du hast hierzu Deine Einwilligung gegeben oder wir sind zur Preisgabe dieser Daten verpflichtet, beispielsweise aufgrund einer gerichtlichen Entscheidung. Dies gilt auch, wenn ein begr체ndeter Verdacht einer missbr채uchlichen Nutzung besteht. Ein Missbrauch liegt dann vor, wenn gegen geltende Gesetze oder die Bestimmungen der Nutzungsbedingungen von eSport Studio verstoen wird. Der Nutzer willigt in diesen F채llen ausdr체cklich in die Weitergabe seiner Daten an Gerichte und Beh철rden ein.</p>\n\n<p>b) Die Erhebung der personenbezogenen Daten (nachfolgend Daten) dient uns zur bedarfsgerechten und user-orientierten Gestaltung der eSport Veranstaltung-Webseiten von eSport Studio oder vom Partnerunternehmen f체r Zwecke der Werbung oder der Marktforschung. Dabei arbeitet eSport Studio mit Nutzungsprofilen, die eSport Studio in der Folge unter Umst채nden nicht mehr mit Namen oder anderen Angaben, die jemanden identifizieren, zusammenf체hrt. Diese Manahmen bestehen insbesondere in der Einblendung von regionaler Werbung und angepasster Werbung, zum Beispiel um regionale Werbung (nach Herkunftsort) und gruppenspezifische Werbung (d.h. nach Gruppen innerhalb von eSport Studio ausgew채hlter Werbung) auf Webseiten von eSportStudio oder vom Partnerunternehmen zu schalten. Die Einblendung von Werbung erfolgt durch eSport Studio, deren Kooperationspartner oder durch Werbepartner. Dabei k철nnen auch der Kooperations- und der Werbepartner zur Erfolgsauswertung ein Cookie setzen, mit dessen Hilfe der entsprechende Server den Erfolg der Werbung nach z.B. Klicks auswerten kann. Grundlage der Datenschutzbestimmungen bei eSport Studio sind jedoch nur die eigenen Cookies und nicht die von Kooperations- und Werbepartnern. Den im vorstehenden Absatz beschriebenen Manahmen kann jederzeit widersprochen werden. So kann regionale Werbung und angepasste Werbung innerhalb der Einstellungsseiten des Profils abgeschaltet werden. Dann wird nur noch standardisierte Werbung eingeblendet.</p>\n\n<p>Jeder Zugriff auf unsere Website und jeder Abruf einer auf der Website hinterlegten Datei werden protokolliert. Die Speicherung dient internen systembezogenen und statistischen Zwecken. Protokolliert werden k철nnen Name der abgerufenen Datei, Datum und Uhrzeit des Abrufs, 체bertragene Datenmenge, Meldung 체ber erfolgreichen Abruf, Webbrowser, anfragende Domain, Cookie Informationen (mit Hilfe dieser Cookies k철nnen bei dem Aufruf unserer Webseite Daten auf Ihrem Rechner gespeichert werden. Du hast die M철glichkeit, das Abspeichern von Cookies auf Ihrem Rechner durch entsprechende Einstellungen in Ihrem Browser zu verhindern. Hierdurch k철nnte allerdings der Funktionsumfang unseres Angebotes eingeschr채nkt werden), Logfile Informationen (Informationen, die automatisch vom Server beim Besuch der Website protokolliert werden) und Clear GIF Informationen (kleine Grafiken, die eine statistische Analyse ohne personenbezogene Daten erm철glichen). Bei der Auswertung der vorgenannten Dateien (z.B. Analyse des Nutzerverhaltens f체r personenbezogene Werbung) wird auch der Clickstream zu den, durch die und aus den Websites von eSport Studio analysiert und dahingehend untersucht, welche Bereiche auf eSport Studio wie oft aufgesucht und/oder gesucht werden. Auf diesem Wege k철nnen besondere Angebote und Services pr채sentiert werden, deren Inhalt auf den im Zusammenhang mit der Clickstream-Analyse erlangten benutzerdefinierten Informationen basiert (z.B. personalisierte Werbung, die auf einen Nutzer ausgerichtet ist, der bestimmte Sportfavoriten oder Sportsets hat).</p>\n\n<p>c) Zus채tzlich werden die IP-Adressen der anfragenden Rechner protokolliert. Die IP-Adressen der Benutzer werden zu Sicherheits- und berwachungszwecken aufgezeichnet. Damit soll ein Missbrauch unseres Dienstes verhindert werden. Ohne eine solche Speicherung k철nnten wir der Erstellung von Fakeprofilen, der Verbreitung von Spam, Flooding, Phishing oder Viren nicht ausreichend entgegenwirken. F체r die Sicherheit von (insbesondere jugendlichen) Usern, f체r vorbeugende Manahmen gegen zuk체nftige Straftaten und f체r eine m철gliche Verfolgbarkeit von 체ber unseren Dienst begangenen Straftaten ist eine Speicherung der IP-Adressen erforderlich.</p>\n\n<p>Unter Umst채nden verkn체pfen wir personenbezogene Daten aus einem Dienst mit Informationen und personenbezogenen Daten aus anderen Diensten von Kooperationspartnern, denen bezogen auf bestimmten Gebieten exklusive Lizenzrechte f체r das (Mit-)Betreiben der eSport Studio-Seite einger채umt worden sind. Wir werden keine Informationen von DoubleClick-Cookies mit personenbezogenen Daten verkn체pfen, es sei denn, wir haben diesbez체glich Ihre ausdr체ckliche Einwilligung erhalten.</p>\n\n<p>d) Die von eSport Studio (ggf. auch in Kooperation mit einem Partnerunternehmen) angelegten Turniere mit allen Angaben, Statistiken, Inhalten unterliegen grunds채tzlich auch den hier getroffenen Regelungen und Erkl채rungen, wobei eine Einschr채nkung des Einsehens der Daten nicht vorgesehen ist, so dass jeder Nutzer alle Seiten besuchen kann, es sei denn, dass Seiten gebildet werden, die nur gegen zus채tzliches Entgelt aufgerufen werden k철nnen. Eine Teilnahmeberechtigung an den Turnieren von eSport Studio in Kooperation mit dem Olympia Verlag setzt aber eine Registrierung voraus, ebenso Kommentierung u.채., das Einstellen von eigenem Content. eSport Studio ist berechtigt, die Befugnis zur Teilnahme nach billigem Ermessen zu entziehen, wenn sich herausstellt, dass der User unwahre Tatsachen oder rechtsverletzende Werturteile verbreitet.</p>\n\n<h5><strong>Verwendung anderer Dienste</strong></h5>\n\n<p>Die Nennung der nachgenannten Dienste ist nicht abschlieend, es k철nnen von eSport Studio auch andere Anbieter eingebunden werden, unter Wahrung Ihrer Datenschutzrechte.</p>\n\n<p>a) eSport Studio benutzt Piwik, eine Open-Source-Software zur statistischen Auswertung der Besucherzugriffe. Piwik verwendet sog. Cookies, Textdateien, die auf Ihrem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Sie erm철glichen. Die durch den Cookie erzeugten Informationen 체ber Ihre Benutzung dieses Internetangebotes werden auf dem&nbsp;Server des Anbieters in Deutschland&nbsp;gespeichert.&nbsp;Die IP-Adresse wird sofort nach der Verarbeitung und vor deren Speicherung anonymisiert.&nbsp;Sie k철nnen die Installation der Cookies durch eine entsprechende Einstellung Ihrer Browser-Software verhindern; wir weisen Sie jedoch darauf hin, dass Sie in diesem Fall gegebenenfalls nicht s채mtliche Funktionen dieser Website vollumf채nglich nutzen k철nnen.&nbsp; Wir weisen darauf hin, dass ggf. ein Partner, auf deren Webseiten die Veranstaltung eingebunden ist, andere Webanalysedienste nutzt, so z.B. Google Analytics. (Google Analytics verwendet sog. Cookies, Textdateien, die auf Deinem Computer gespeichert werden und die eine Analyse der Benutzung der Website durch Dich&nbsp;erm철glicht. Die durch den Cookie erzeugten Informationen 체ber Deine&nbsp;Benutzung dieser Website werden in der Regel an einen Server von Google in den USA 체bertragen und dort gespeichert. Im Falle der Aktivierung der IP-Anonymisierung auf dieser Webseite wird Deine&nbsp;IP-Adresse von Google jedoch innerhalb von Mitgliedstaaten der Europ채ischen Union oder in anderen Vertragsstaaten des Abkommens 체ber den Europ채ischen Wirtschaftsraum zuvor gek체rzt. Nur in Ausnahmef채llen wird die volle IP-Adresse an einen Server von Google in den USA 체bertragen und dort gek체rzt. Im Auftrag des Betreibers dieser Website wird Google diese Informationen benutzen, um Deine&nbsp;Nutzung der Website auszuwerten, um Reports 체ber die Websiteaktivit채ten zusammenzustellen und um weitere mit der Websitenutzung und der Internetnutzung verbundene Dienstleistungen gegen체ber dem Websitebetreiber zu erbringen. Die im Rahmen von Google Analytics von Deinem&nbsp;Browser 체bermittelte IP-Adresse wird nicht mit anderen Daten von Google zusammengef체hrt. Du&nbsp;kannst dar체ber hinaus die Erfassung der durch das Cookie erzeugten und auf Deine&nbsp;Nutzung der Website bezogenen Daten (inkl. Ihrer IP-Adresse) an Google sowie die Verarbeitung dieser Daten durch Google verhindern, indem Du&nbsp;das unter dem folgenden Link verf체gbare Browser-Plugin herunterl채dst und installierst:&nbsp;<a href="http://tools.google.com/dlpage/gaoptout?hl=de" target="_blank">http://tools.google.com/dlpage/gaoptout?hl=de</a>.) eSport Studio benutzt ggf. zudem Google AdSense, einen Dienst zum Einbinden von Werbeanzeigen der Google Inc. (Google). Google AdSense verwendet sog. Cookies, Textdateien, die auf Deinem&nbsp;Computer gespeichert werden und die eine Analyse der Benutzung der Website erm철glicht. Google AdSense verwendet auch so genannte Web Beacons (unsichtbare Grafiken). Durch diese Web Beacons k철nnen Informationen wie der Besucherverkehr auf diesen Seiten ausgewertet werden. Die durch Cookies und Web Beacons erzeugten Informationen 체ber die Benutzung dieser Website (einschlielich Ihrer IP-Adresse) und Auslieferung von Werbeformaten werden an einen Server von Google in den USA 체bertragen und dort gespeichert. Diese Informationen k철nnen von Google an Vertragspartner von Google weitergegeben werden. Google wird Deine&nbsp;IP-Adresse jedoch nicht mit anderen von Dir&nbsp;gespeicherten Daten zusammenf체hren. Die Weitergabe von personenbezogenen Daten durch eSport Studio an solche Dienste wie Facebook, Google, Youtube, Twitter u.채. wird ausgeschlossen. Du kannst&nbsp;die Installation der Cookies durch eine entsprechende Einstellung Deiner&nbsp;Browser Software verhindern; wir weisen Dich&nbsp;jedoch darauf hin, dass Du&nbsp;in diesem Fall gegebenenfalls nicht s채mtliche Funktionen dieser Website voll umf채nglich nutzen kannst. Durch die Nutzung dieser Website erkl채rst Du&nbsp;dich mit der Bearbeitung der 체ber Dich&nbsp;erhobenen Daten durch Google in der zuvor beschriebenen Art und Weise und zu dem zuvor benannten Zweck einverstanden.</p>\n\n<p>b) Mithilfe der Google +1-Schaltfl채che kannst Du&nbsp;Informationen weltweit ver철ffentlichen. 체ber die Google +1-Schaltfl채che erh채ltst Du&nbsp;und andere Nutzer personalisierte Inhalte von Google und unseren Partnern. Google speichert sowohl die Information, dass Du&nbsp;f체r einen Inhalt +1 gegeben hast, als auch Informationen 체ber die Seite, die Du&nbsp;beim Klicken auf +1 angesehen hast. Deine&nbsp;+1 k철nnen als Hinweise zusammen mit Deinem&nbsp;Profilnamen und Deinem&nbsp;Foto in Google-Diensten, wie etwa in Suchergebnissen oder in Deinem&nbsp;Google-Profil, oder an anderen Stellen auf Websites und Anzeigen im Internet eingeblendet werden.</p>\n\n<p>Google zeichnet Informationen 체ber Deine +1-Aktivit채ten auf, um die Google-Dienste f체r Dich und andere zu verbessern. Um die Google +1-Schaltfl채che verwenden zu k철nnen, ben철tigst Du ein weltweit sichtbares, 철ffentliches Google-Profil, das zumindest den f체r das Profil gew채hlten Namen enthalten muss. Dieser Name wird in allen Google-Diensten verwendet. In manchen F채llen kann dieser Name auch einen anderen Namen ersetzen, den Du beim Teilen von Inhalten 체ber Ihr Google-Konto verwendet hast. Die Identit채t Deines Google-Profils kann Nutzern angezeigt werden, die Deine E-Mail-Adresse kennen oder 체ber andere identifizierende Informationen von Dir verf체gen.</p>\n\n<p>Neben den oben erl채uterten Verwendungszwecken werden die von Dir bereitgestellten Informationen gem채 den geltenden Google-Datenschutzbestimmungen genutzt. Google ver철ffentlicht m철glicherweise zusammengefasste Statistiken 체ber die +1-Aktivit채ten der Nutzer bzw. gibt diese an Nutzer und Partner weiter, wie etwa Publisher, Inserenten oder verbundene Websites.</p>\n\n<p>c) eSport Studio verwendet Social Plugins (Plugins- hierbei insbesondere den Button Gef채llt mir) des sozialen Netzwerkes facebook.com, welches von der Facebook Inc., 1601 S. California Ave, Palo Alto, CA 94304, USA betrieben wird (Facebook). Die Plugins sind mit einem Facebook Logo oder dem Zusatz Facebook Social Plugin gekennzeichnet. Plugins sind Computerprogramme, die zur Erweiterung der Funktionalit채t in ein anderes Softwareprodukt eingebettet sind. Solltest Du eine Webseite unseres Internetauftritts aufrufen, die ein solches Plugin enth채lt, wird eine direkte Verbindung mit den Servern von Facebook hergestellt, der Inhalt des Plugins von Facebook direkt an Deinen Browser 체bermittelt und von diesem in die Webseite eingebunden. Durch die Einbindung der Plugins erh채lt Facebook die Information, dass Du die entsprechende Seite unseres Internetauftritts aufgerufen hast. Bist Du bei Facebook eingeloggt kann Facebook den Besuch Deinem Facebook-Konto zuordnen. Wenn Du mit den Plugins interagierst, zum Beispiel den Gef채llt mir Button bet채tigst oder einen Kommentar abgibst, wird die entsprechende Information direkt an Dein Facebook-Konto 체bermittelt, gespeichert und ggf. dort angezeigt. Umfassende Informationen zur Erhebung, Speicherung und Nutzung Deiner Daten durch Facebook, zur diesbez체glichen Aus체bung Deiner Rechte und zum Schutz Ihrer Privatsph채re findest Du in den Facebook Datenschutzrichtlinien und dem Leitfaden zur Privatsph채re. Wenn Du nicht m철chtest, dass Facebook 체ber den Internetauftritt von eSport Studio personenbezogen Daten 체ber Dich sammelt, musst Du dich vor Deinem Besuch unseres Internetauftritts lediglich bei Facebook ausloggen.</p>\n\n<p>d) Auf den Seiten von eSport Studio sind auch Funktionen des Dienstes Twitter eingebunden. Diese Funktionen werden angeboten durch die Twitter Inc., 795 Folsom St., Suite 600, San Francisco, CA 94107, USA. Durch das Benutzen von Twitter und der Funktion Re-Tweet werden die von Dir besuchten Webseiten mit Deinem Twitter-Account verkn체pft und anderen Nutzern bekannt gegeben. Dabei werden auch Daten an Twitter 체bertragen.</p>\n\n<p>Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der 체bermittelten Daten sowie deren Nutzung durch Twitter erhalten. Weitere Informationen hierzu findest Du in der Datenschutzerkl채rung von Twitter unter&nbsp;<a href="http://twitter.com/privacy" target="_blank">http://twitter.com/privacy</a>.</p>\n\n<p>Deine&nbsp;Datenschutzeinstellungen bei Twitter kannst Du&nbsp;in den Konto-Einstellungen unter&nbsp;<a href="http://twitter.com/account/settings" target="_blank">http://twitter.com/account/settings&nbsp;</a>채ndern.</p>\n\n<h5><strong>Einwilligungserkl채rungen</strong></h5>\n\n<p>Durch Deine Zustimmung zu den Datenschutzbestimmungen gibst Du zugleich folgende Einwilligungen ab:</p>\n\n<ul>\n	<li>die Einwilligung, dass die bei meiner Registrierung mitgeteilten Stammdaten allen Nutzern der Websites des Partnerunternehmens oder von Webseiten von eSportStudio zug채nglich sind und von diesen eingesehen werden k철nnen.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass eine von mir auf Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio hochgeladene und meinem eigenen Profil hinzugef체gte Bilddatei allen Nutzern der Websites des Partnerunternehmens oder von Webseiten von eSportStudio zug채nglich ist und von diesen eingesehen werden kann.</li>\n</ul>\n\n<p><em>(Hinweis: Du hast jederzeit die M철glichkeit, den Zugriff der User auf Deine weiteren personenbezogenen Daten einzuschr채nken oder auszuschlieen)</em></p>\n\n<ul>\n	<li>die Einwilligung, dass eSport Studio Cookies verwendet und damit Nutzungsdaten von mir erhebt, verarbeitet und nutzt, wie unter den Ziffern 2 und 3 beschrieben. So k철nnen etwa die beim Einloggen f체r meine Authentifizierung abgefragten Daten gespeichert werden, um mir ein vereinfachtes Einloggen zu erm철glichen. Dar체ber hinaus dienen Cookies unter anderem auch der pers철nlichen Begr체ung und der Bereitstellung von Anwendungen, die auf mich als Nutzer zugeschnitten sind.</li>\n</ul>\n\n<ul>\n	<li>die Einwilligung, dass bei einem von mir veranlassten Zugriff auf Webseiten des Partnerunternehmens oder auf Webseiten von eSportStudio automatisch Informationen durch den von mir verwendeten Internet-Browser 체bermittelt werden und dass eSport Studio diese in den so genannten Protokolldateien gespeicherten Daten auswertet und analysiert, wie unter Ziffer 2. (s.o.) aufgef체hrt, also dass auch dass die beispielsweise genannten Daten in Ziffer 2 in den Datenbanken und in den File