	(82, 'content:3.content', 'wysiwyg', '<ol>\n	<li>Das eSportStudio (eSport Studio GmbH &amp; Co.KG, Ganghoferstr. 68, 80339 M체nchen) veranstaltet zusammen mit dem Partner elektronische Turnierwettbewerbe (non-live) f체r Videogames. Die Partner stellen hierf체r ein eSportStudio geh철rendes Turniersystem mit einem vorgegebenen Turnierbaum und nach bestimmten, hier aufgestellten Regeln (Teilnahmebedingungen) zur Verf체gung. Die Durchf체hrung des Spielbetriebes bei den jeweiligen Turnieren verantwortet eSportStudio. Die vorliegenden Teilnahmebedingungen sollten vor Deiner Teilnahme als Spieler an einem solchen Gaming Turnierwettbewerb (nachfolgend Turniere) vollst채ndig gelesen werden. Bei Deiner ersten Anmeldung zu einem Turnier oder bei einer sonstigen Registrierung im Turniersystem f체r einen dortigen Account akzeptierst Du als Spieler die hier vorliegenden Bedingungen. Spieler, die die Bedingungen ablehnen und diese nicht akzeptieren, werden nicht registriert und d체rfen nicht spielen.</li>\n	<li>F체r die Teilnahme ist eine Internetverbindung erforderlich, es sei denn, eSportStudio veranstaltet Live-Turniere an einem bestimmten Spielort. F체r die Durchf체hrung der Onlinespiele sind die Teilnehmer selbst verantwortlich. Hierbei sind die Magaben und das Regelwerk von eSportStudio zu beachten.</li>\n	<li>Um teilnahmeberechtigt zu sein, setzt dies grunds채tzlich die Vollendung des 12. Lebensjahres voraus und ist eine vollst채ndige Registrierung bei der Anmeldung f체r die Turniere im Turniersystem notwendig. F체r einzelne Turniere k철nnen aber andere Altersbeschr채nkungen gelten. Hierauf wird gesondert hingewiesen. Diese Abweichungen gehen dann der Ziffer 3 vor.</li>\n	<li>F체r die Aktualit채t dieser Daten ist der Spieler selbst verantwortlich. Jede Teilnahme an einem Turnier setzt eine gesonderte Anmeldung unabh채ngig von der Erstregistrierung voraus. Falsche Angaben oder fehlende Registrierung k철nnen zum Ausschluss, auch aus bereits gestarteten Wettbewerben, f체hren. Manipulationen oder Unregelm채igkeiten, die Spielern bekannt werden, m체ssen bis sp채testens 3 Tage nach Ende eines Wettbewerbes angemeldet werden. Sp채ter eingehende Beschwerden k철nnen nicht ber체cksichtigt werden, ausgenommen Betrugshinweise. F체r die Registrierung sind bestimmte pers철nliche Informationen zur Verf체gung zu stellen (siehe Datenschutzbestimmungen). Du erkennst an und akzeptierst, dass Deine pers철nlichen Informationen korrekt sind, von uns gespeichert und verwendet werden k철nnen, als auch von unseren Vertragspartnern, unseren Vertretern und anderen in unserem Auftrag handelnden Unternehmen bearbeitet werden k철nnen. Auch ist eSportStudio erlaubt, im Auftrag f체r Dritte, auf deren Seiten die Turniere stattfinden, die erhobenen Daten zu verarbeiten.Deine Spielinformationen k철nnen von uns f체r einen oder mehrere der folgenden inhaltlichen Zwecke verwendet werden (unbeschadet der weiteren Befugnisse weiterer Datenerhebung, welche in den von Dir anzuerkennenden Datenschutzbestimmungen festgelegt sind):\n	<ul>\n		<li>Zur Anzeige von Daten in Bezug auf das Turnierergebnis online sowie in Ranglisten;</li>\n		<li>Zur Kommunikation mit Dir hinsichtlich der Zusendung eines Preises;</li>\n		<li>F체r interne administrative Zwecke</li>\n		<li>Zur Identifikation bei einem Live-Turnier</li>\n		<li>F체r Rankings, Tabellen, Statistiken, Ligasysteme</li>\n		<li>F체r Strafen bei unfairem Verhalten</li>\n		<li>Zur Durchf체hrung von Kooperation mit Dritten, an die die Rechte der Beteiligung wie nachfolgend beschrieben 체bertragen oder lizenziert werden k철nnen.</li>\n	</ul>\n	Die vorgenommene Registrierung k철nnen Sie jederzeit widerrufen, durch eine E-Mail an&nbsp;<a href="mailto:cup-support@eSportStudio.de" target="_top">cup-support@eSportStudio.de</a></li>\n	<li>Du stimmst hiermit zu, dass wir Dir gelegentlich Informationen 체ber Ereignisse oder Neuigkeiten zusenden sowie Dienste des Kundenservice f체r Dich bereitstellen k철nnen, sofern dies bei der Anmeldung von Dir ausdr체cklich akzeptiert wurde durch das Anklicken dieser Option auf einen Newsletter. Wenn Du unseren Newsletter nicht erhalten m철chtest, kannst Du ihn abbestellen, indem Du uns bitte eine E-Mail an&nbsp;<a href="mailto:cup-support@eSportStudio.de" target="_top">cup-support@eSportStudio.de</a>&nbsp;schickst, damit wir Dich aus der Liste entfernen.</li>\n	<li>eSportStudio ist alleiniger Inhaber aller Rechte am eSportStudio Turniersystem - dazu z채hlen das Urheberrecht, die Gesch채ftsgeheimnisse, geistiges Eigentum und alle anderen Rechte, die durch die Entwicklung des Systems entstanden sind (z.B. Markenrechte). eSportStudio ist frei in der Nutzung aller Spielergebnisse und hat durch die Registrierung das Recht, das jeweilige Turnier, die Spielergebnisse unter Nennung der Teilnehmernahmen (durch Werbung, Sponsoringpartner, u.채.) zu vermarkten. Ebenso ist es nicht gestattet, auf der Seite abgebildete Logos, Grafiken, Fotos von Dritten zu nutzen.</li>\n	<li>eSportStudio und seine Vertragspartner lehnen jede und alle Gew채hrleistungen, ausdr체cklich oder stillschweigend, in Verbindung mit dem Turniersystem, mit der Funktion, den Systemvoraussetzungen der Software der Spielhersteller ab. eSportStudio und seine Vertragspartner geben keinerlei Gew채hrleistung oder Zusicherung bzgl. ihrer Qualit채t, Eignung, Vollst채ndigkeit oder Richtigkeit. eSportStudio und seine Vertragspartner behalten sich das Recht vor, das Turniersystem nach alleinigem Ermessen - und ohne Anzeigepflicht Dir gegen체ber - mit sofortiger Wirkung zu sperren, einzustellen, zu 채ndern, zu l철schen oder Erg채nzungen vorzunehmen. Insbesondere ist f체r die Erreichbarkeit seines Turnierger채tes der jeweilige Spieler selbst verantwortlich.</li>\n	<li>Kein Spieler, der an einem Turnier teilnimmt, darf in irgendeiner Weise Nachrichten oder Inhalte zeigen, anzeigen oder kommunizieren, die rassistisch, obsz철n, abf채llig oder auf andere Weise rechtswidrig die Rechtsg체ter eines Dritten verletzt. Dazu geh철rt auch die etwaige Verletzung von Bild- (auch Avatare), Namens- oder/und Markenrechten Dritter.</li>\n	<li>Informationen zu Wettbewerben, insbesondere Live-Turnieren, werden auf den Seiten, in die das System eingebunden ist oder auf anderen Partnerseiten ver철ffentlicht. Die Turnierpl채ne von Live-Turnieren sind zu Beginn eines Turniers im Turniersystem einsehbar. eSportStudio weist darauf hin, dass angegebene Startzeiten (bei Folgespielen ungef채hr) unter einem Vorbehalt stehen und sich 채ndern k철nnen.</li>\n	<li>Gewinne werden binnen 2 Wochen nach Ende des Wettbewerbes versendet. Eine Versendung erfolgt dann nicht bzw. der Anspruch entf채llt, wenn der ausgelobte Gewinn einer bestimmten Altersgrenze nach den Jugendschutzbestimmungen unterliegt und der Gewinner diese nicht erreicht hat. Preise und Teilnahmeberechtigungen sind nicht 체bertragbar. eSportStudio haftet nicht f체r den Verlust eines Gewinns bei dessen Zusendung.</li>\n	<li>Im Falle der Durchf체hrung eines Live-Turniers an einer Spielst채tte erkl채rst Du dich mit der Anmeldung zu einem Turnier mit folgendem einverstanden: Bei Deiner Teilnahme an einem solchen Turnier erkl채rst Du dich ausdr체cklich damit einverstanden, dass eSportStudio oder seine Vertragspartner Foto- und Filmaufnahmen machen d체rfen und das exklusive Recht erh채lt, diese Aufnahmen zeitlich unbegrenzt weltweit in allen digitalen und analogen Medien zu nutzen (auf allen Abspielger채ten, insbesondere im Internet, im TV; mit eingeschlossen ohne Einschr채nkung sind daher insbesondere das Streaming unserer Berichterstattung 체ber das Turnier im Internet, der Produktion und Vertreibung von Video-Blogs 체ber das Turnier im Internet sowie die Produktion und Ver철ffentlichung/Verbreitung von Promotionen 체ber das Turnier bzw. anderes Marketing-Material in Zusammenhang mit dem Turnier). eSportStudio hat ferner die Befugnis diese Aufnahmen zu bearbeiten, auch mit Werbung (z.B. Splitscreen) zu versehen und die entsprechende Produktion in allen Sprachen (Synchrorecht) zu ver철ffentlichen und zu archivieren. Alle Rechte kann eSportStudio auf Dritte 체bertragen. Werbung auf Kleidungen sind nur dann erlaubt, wenn diese nicht dominant sind und nicht im Widerspruch zu Werbemanahmen von eSportStudio stehen.</li>\n</ol>\n'),
