	(84, 'content:1.lead', 'wysiwyg', '<p>Mitmachen und Gewinnen!</p>\n'),
	(84, 'content:2.image', 'image', 'a:9:{s:2:"id";i:73;s:3:"alt";s:0:"";s:11:"cropPercent";N;s:9:"cropWidth";N;s:10:"cropHeight";N;s:7:"cropTop";N;s:8:"cropLeft";N;s:8:"hotspots";a:0:{}s:6:"marker";a:0:{}}'),
	(84, 'content:3.content', 'wysiwyg', '<p>Am Donnerstag, den 11. Januar heit es wieder ran an die PlayStation 4, denn der f체nfte GameZ Cup steht an. Nachdem zuletzt Madden-Fans gefragt waren, k철nnen nun wieder FIFA 18-Enthusiasten ihre F채higkeiten zur Schau stellen. Obendrauf gibt es noch coole Preise zu gewinnen: Der Erstplatzierte erh채lt n채mlich einen MediaMarkt-Gutschein im Wert von 50 Euro und dazu noch einen SNES Mini!</p>\n\n<p>Seid ihr also im Besitz einer PlayStation 4 mit FIFA 18, habt eine funktionierende Internetleitung, Playstation Plus und am Donnerstagabend ab 18:30 Uhr Zeit, dann meldet euch jetzt unter GameZ.de/Cups an. Check-In ist ab 16:30 Uhr und solltet ihr die Anmeldung verpasst haben, gibt es ab 18 Uhr noch eine letzte Chance, bei der ihr euch die 체brig gebliebenen Pl채tze sichern k철nnt. Gespielt wird auerdem im klassischen Head2Head-Modus, also 체berlegt euch eure Teamauswahl gut!</p>\n\n<p>Alle Informationen zum Ablauf und Regelwerk findet ihr ebenfalls unter GameZ.de/Cups. Bitte bedenkt auerdem, dass es sich hierbei um ein Beta-Turnier handelt und vielleicht nicht alles perfekt l채uft. F채llt euch etwas auf oder habt ihr anderes Feedback oder Verbesserungsw체nschen, schreibt uns gerne unter&nbsp;<a href="mailto:gamezde@mediamarkt.de" target="_top">gamezde@mediamarkt.de</a>&nbsp;eine Mail.</p>\n\n<p>&nbsp;</p>\n'),
	(84, 'headline', 'input', 'GameZ Cups: N채chstes Turnier am 11. Januar');
