INSERT INTO `object_localized_data_2` (`ooo_id`, `language`, `title`, `shortText`, `text`, `pageTitle`) VALUES
	(3, 'de', 'NGL-Pro-Club-Series-Spieltag-11-12-13', 'Mitmachen und Gewinnen!', '<p>Am Donnerstag, den 11. Januar heit es wieder ran an die PlayStation 4, denn der f체nfte GameZ Cup steht an. Nachdem zuletzt Madden-Fans gefragt waren, k철nnen nun wieder FIFA 18-Enthusiasten ihre F채higkeiten zur Schau stellen. Obendrauf gibt es noch coole Preise zu gewinnen: Der Erstplatzierte erh채lt n채mlich einen MediaMarkt-Gutschein im Wert von 50 Euro und dazu noch einen SNES Mini!</p>\n\n<p>Seid ihr also im Besitz einer PlayStation 4 mit FIFA 18, habt eine funktionierende Internetleitung, Playstation Plus und am Donnerstagabend ab 18:30 Uhr Zeit, dann meldet euch jetzt unter GameZ.de/Cups an. Check-In ist ab 16:30 Uhr und solltet ihr die Anmeldung verpasst haben, gibt es ab 18 Uhr noch eine letzte Chance, bei der ihr euch die 체brig gebliebenen Pl채tze sichern k철nnt. Gespielt wird auerdem im klassischen Head2Head-Modus, also 체berlegt euch eure Teamauswahl gut!</p>\n\n<p>Alle Informationen zum Ablauf und Regelwerk findet ihr ebenfalls unter GameZ.de/Cups. Bitte bedenkt auerdem, dass es sich hierbei um ein Beta-Turnier handelt und vielleicht nicht alles perfekt l채uft. F채llt euch etwas auf oder habt ihr anderes Feedback oder Verbesserungsw체nschen, schreibt uns gerne unter&nbsp;<a data-tabindex-counter="1" data-tabindex-value="none" href="mailto:gamezde@mediamarkt.de" tabindex="-1" target="_top">gamezde@mediamarkt.de</a>&nbsp;eine Mail.</p>\n', 'GameZ Cups: N채chstes Turnier am 11. Januar'),
	(3, 'en', 'NGL-Pro-Club-Series-Spieltag-11-12-13', 'Nullam dictum felis eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus.', '<p>Cras dapibus. Vivamus elementum semper nisi. Aenean vulputate eleifend tellus. Aenean leo ligula, porttitor eu, consequat vitae, eleifend ac, enim. Aliquam lorem ante, dapibus in, viverra quis, feugiat a, tellus. Phasellus viverra nulla ut metus varius laoreet. Quisque rutrum. Aenean imperdiet. Etiam&nbsp;<a data-tabindex-counter="1" data-tabindex-value="none" href="/de/other/basic-examples/content-page" pimcore_id="24" pimcore_type="document" tabindex="-1">ultricies&nbsp;</a>nisi vel augue.</p>\n\n<p>Curabitur ullamcorper ultricies nisi. Nam eget dui. Etiam rhoncus. Maecenas tempus, tellus eget&nbsp;<a data-tabindex-counter="1" data-tabindex-value="none" href="/de/other/basic-examples/galleries" pimcore_id="19" pimcore_type="document" tabindex="-1">condimentum&nbsp;rhoncus</a>, sem quam semper libero, sit amet adipiscing sem neque sed ipsum. Nam quam nunc, blandit vel, luctus pulvinar, hendrerit id, lorem. Maecenas nec odio et ante tincidunt tempus.</p>\n', 'GameZ Cups: N채chstes Turnier am 11. Januar'),
	(4, 'de', 'Li Europan lingues es membres', 'Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular.', '<p>Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental in fact, it va esser Occidental. A un Angleso it va semblar un simplificat Angles, quam un skeptic Cambridge amico dit me que Occidental es.Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular.</p>\n\n<p>Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles.</p>\n', NULL),
