	(3, 'de', 'NGL-Pro-Club-Series-Spieltag-11-12-13', 'Mitmachen und Gewinnen!', 'Am Donnerstag, den 11. Januar heit es wieder ran an die PlayStation 4, denn der f체nfte GameZ Cup steht an. Nachdem zuletzt Madden-Fans gefragt waren, k철nnen nun wieder FIFA 18-Enthusiasten ihre F채higkeiten zur Schau stellen. Obendrauf gibt es noch coole Preise zu gewinnen: Der Erstplatzierte erh채lt n채mlich einen MediaMarkt-Gutschein im Wert von 50 Euro und dazu noch einen SNES Mini! Seid ihr also im Besitz einer PlayStation 4 mit FIFA 18, habt eine funktionierende Internetleitung, Playstation Plus und am Donnerstagabend ab 18:30 Uhr Zeit, dann meldet euch jetzt unter GameZ.de/Cups an. Check-In ist ab 16:30 Uhr und solltet ihr die Anmeldung verpasst haben, gibt es ab 18 Uhr noch eine letzte Chance, bei der ihr euch die 체brig gebliebenen Pl채tze sichern k철nnt. Gespielt wird auerdem im klassischen Head2Head-Modus, also 체berlegt euch eure Teamauswahl gut! Alle Informationen zum Ablauf und Regelwerk findet ihr ebenfalls unter GameZ.de/Cups. Bitte bedenkt auerdem, dass es sich hierbei um ein Beta-Turnier handelt und vielleicht nicht alles perfekt l채uft. F채llt euch etwas auf oder habt ihr anderes Feedback oder Verbesserungsw체nschen, schreibt uns gerne unter&nbsp;<a data-tabindex-counter="1" data-tabindex-value="none" href="mailto:gamezde@mediamarkt.de" tabindex="-1" target="_top">gamezde@mediamarkt.de</a>&nbsp;eine Mail. ', 'GameZ Cups: N채chstes Turnier am 11. Januar'),
	(4, 'de', 'Li Europan lingues es membres', 'Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular.', 'Li nov lingua franca va esser plu simplic e regulari quam li existent Europan lingues. It va esser tam simplic quam Occidental in fact, it va esser Occidental. A un Angleso it va semblar un simplificat Angles, quam un skeptic Cambridge amico dit me que Occidental es.Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilite de un nov lingua franca: On refusa continuar payar custosi traductores. At solmen va esser necessi far uniform grammatica, pronunciation e plu sommun paroles. ', NULL),
