	(28, '/en/basic-examples/properties', 'document', 'page', 'page', 1, 1368615986, 1382956040, 0, 0, 'ID: 28  \nPath: /en/basic-examples/properties  \n On this page we use "Properties" to hide the navigation on the left and to change the color of the header to blue.&nbsp; Properties are very useful to control the behavior or to store meta data of documents, assets and objects. And the best: they are inheritable.&nbsp; &nbsp; On the following screens you can see how this is done in this example. Properties ', 'blog:/en/advanced-examples/blog mainNavStartNode:/en sidebar:/en/sidebar language:en leftNavStartNode:/en/basic-examples navigation_name:Properties leftNavHide:1 headerColor:blue '),
