	(29, '/en/basic-examples/tag-and-snippet-management', 'document', 'page', 'page', 1, 1368617118, 1395043636, 0, 0, 'ID: 29  \nPath: /en/basic-examples/tag-and-snippet-management  \n This page demonstrates how to use the "Tag &amp; Snippet Management" to inject codes into the HTML source code. This functionality can be used to easily integrate tracking codes, conversion codes, social plugins and whatever that needs to go into the HTML. &nbsp; The functionality is similar to this products:&nbsp; http://www.google.com/tagmanager/&nbsp; http://www.searchdiscovery.com/satellite/&nbsp; http://www.tagcommander.com/en/ &nbsp; In our example we use it to integrate a facebook social plugin. Tag & Snippet Management ... gives all the freedom back to the marketing dept. ', 'sidebar:/en/sidebar blog:/en/advanced-examples/blog mainNavStartNode:/en leftNavStartNode:/en/basic-examples language:en navigation_name:Tag & Snippet Management '),
