Plugins Pimcore Demo Side - The Dev4Demo Project Plugin Developer\'s Guide Example Plugin Anatomy and Design Plugin Backend (PHP) UI Development and JS Hooks Useful Hints Develop for pimcore Releasing a new Version SVN Code-Repository and GitHub FAQ Archive Screencasts Install Example Data VMware Demo Image Commandline Updater CDN (Content Delivery Network) Google Summer of Code 2012 Ideas PhpUnit Tests Templates (Views) As mentioned already before, Pimcore uses Zend_View as its template engine, and the standard template language is PHP. The Pimcore implementation of Zend_View offers special methods to increase the usability: Method Description inc Use this function to directly include a document template Use this method to include a template cache In template caching translate i18n / translations glossary Glossary Additionally you can use the Zend_View helpers which are shipped with ZF. There are some really cool helpers which are really useful when used in combination with Pimcore. Some Examples Method Description action http://framework.zend.com/manual/en/zend.view.helpers.html#zend.view.helpers.initial.action headMeta http://framework.zend.com/manual/en/zend.view.helpers.html#zend.view.helpers.initial.headmeta headTitle http://framework.zend.com/manual/en/zend.view.helpers.html#zend.view.helpers.initial.headtitle translate http://framework.zend.com/manual/en/zend.view.helpers.html#zend.view.helpers.initial.translate You can use your own custom Zend_View helpers, or create some new one to make your life easier. There are some properties which are automatic available in the view: Name Type Description editmode boolean Is true if you are in editmode (admin), false if you are on the website controller Pimcore_Controller_Action_Frontend A reference to the controller document Document Reference to the current document object you can directly access the properties of the document in the view (eg. $this?document?getTitle();) Editables (Placeholders for content) Pimcore offers a basic set of placeholders which can be placed directly into the template. In editmode they appear as an editable widget, where you can put your content in. While in frontend-mode the content is directly embedded into the HTML. There is a standard scheme for how to call the editables. The first argument is always the name of the element (as string), the second argument is an array with multiple options (configurations) in it. Because most of the elements are based directly on Ext.form elements, you can also pass configurations directly to the Ext components (see API reference of Ext) Click here to get a detailed overview about the editables. Example Editables The editables are placeholders in the templates, which are input widgets in the admin (editmode) and output the content in frontend mode. Area (since 1.4.3) Areablock (since 1.3.2) Block Checkbox Date Href (1 to 1 Relation) Image Input Link Multihref (since 1.4.2) Multiselect Numeric Renderlet Select Snippet (embed) Table Textarea Video WYSIWYG General Most of the editables use ExtJS widgets, these editables can be also configured with options of the underlying ExtJS widget. For example: You can also use Zend_Json_Expr to add "native" Javascript to an editable: ', 'document_page_count:39 '),
